INSERT INTO `reviews` (`review_id`, `user_id`, `title`, `description`, `author`, `image`, `rating`, `status`) VALUES
(1, 0, 'Best Travel Experience Ever!', 'I recently booked a flight through BulaTrips, and I must say, the experience was fantastic! The platform is so easy to use, and I got an amazing discount on my ticket. The customer service team was also very responsive when I needed to change my travel dates. Highly recommend!', 'Roger Brooks', 'lady-img2.png', 5, 1),
(2, 0, 'Affordable and Convenient', 'BulaTrips has truly made flight booking so convenient. I found the best deals for my family vacation, and the booking process was seamless. The refund policy also came in handy when one of our plans changed. I’m definitely using BulaTrips for all my future travels.', 'Michael Robinson', 'man-img1.png', 5, 1),
(3, 0, 'Outstanding Service and Support', 'I had an issue with my flight booking, and the BulaTrips team resolved it within minutes. Their support team is so professional and helpful. Plus, their rates are unbeatable! Thank you for making travel stress-free for me.', 'Alisa Jennifer', '', 5, 0),
(4, 31, 'A Game-Changer for Travelers', 'BulaTrips is by far the best travel booking platform I’ve used. It’s user-friendly, has great features like cancellations and refunds, and the prices are incredibly reasonable. It has become my go-to platform for all flight bookings!', 'John Miller\n', 'team-img.png', 5, 0),
(5, 65, 'Easy, Fast, and Reliable', 'Booking with BulaTrips was an absolute breeze! The website is intuitive, and I was able to find the perfect flight at a fantastic price in no time. I also appreciate the flexibility they offer in terms of cancellations and changes. A top-notch service that I will definitely use again!', 'Emma Davis', 'Screenshot 2024-07-24 204926.png', 5, 1);
